query:
query containerFqdnSearch ( $accountId:ID! $fqdnContainerSearchInput:FqdnContainerSearchInput!) {
	container ( accountId:$accountId ) {
		fqdn {
			search ( input:$fqdnContainerSearchInput   ) {
				container {
					id
					name
					description
					size
					audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
					syncData {
						fileType
						url
						timeInterval
						timeUnit
						notifications {
							subscriptionGroup {
								id
								name
							}
							webhook {
								id
								name
							}
							mailingList {
								id
								name
							}
						}
					}
					syncDataAudit {
						lastSynced
						lastSyncAttempt
						errorMsg
					}
				}
			}
		}
	}	
}
